import React, { Component } from 'react';

class MainVideoInfo extends Component {

    render () {
        return (
            <>
                <h1 className = "video-info__header h1-header">{this.props.title}</h1>
                <div className="video-info__chan-date">
                    <h2 className="video-info__chan-date--h2 h2-subheader">By {this.props.channel}</h2>

                </div>
            </>
        );
    }
}
export default MainVideoInfo;
